import './App.scss';

function App() {
  return (
    <div className="App">
      <video className='bg-video' autoPlay loop muted type="video/mp4">
        <source src="canoe-video.mp4" />
        Sorry this video is unavailable
      <div className="navbar">
        <img src="logo.png" />
      </div>
      </video>
    </div>
  );
}

export default App;
